import { Col } from 'react-bootstrap';
import Netflix from '../assets/img/netflix.png';
import Webshop from '../assets/img/webshop.png';
import firstWebsite from '../assets/img/website.png';
import presenting from '../assets/img/presenting.jpg';
import office from '../assets/img/office.jpg';
import master from '../assets/img/master.jpg';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';

export const ProjectCard2 = ({
  title,
  description,
  image,
  link,
  header,
  header2,
  description2,
}) => {
  const images = {
    netflix: Netflix,
    webshop: Webshop,
    firstWebsite: firstWebsite,
    presenting: presenting,
    office: office,
    master: master,
  };

  return (
    <Col size={12} sm={12}>
      <Card sx={{ maxWidth: 345 }} className="proj-imgbx">
        <CardActionArea>
          <CardMedia
            component="img"
            height="140"
            image={images[image]}
            alt="green iguana"
          />
          <CardContent>
            <div className="proj-txtx">
              <h4>{title}</h4>
              <span>{description}</span>
            </div>
          </CardContent>
        </CardActionArea>
      </Card>
    </Col>
  );
};
